  02> PETERSEN, Richard David m on 13.03.1993 to FORSYTH, Deborah Kay
  b 16.11.1964
  b 13.10.1965
  Richard b. at Waipukurau and m, at St Mary's Church, Karori, Wellington, Deborah, d/o Donald
  Eric Forsyth and Helen Margaret Aitken, b. at Wellington. Address: 44 Braithwaite Street,
  Karori, Wellington 5.
  Richard was educated at Terrace Primary School in Waipukurau and Central Hawkes Bay College
  (1978-82). He attended Victoria University of Wellington in 1983-85 and graduated Bachelor of
  Commerce and Administration, majoring in Business Administration. He worked as a sharebroker
  for Jarden and Co in 1986-88.
  Deborah was educated at Karori Normal Primary School and Queen Margaret College (1977-83). She
  attended Victoria University of Wellington in 1984-87 and graduated with a Bachelor of Commerce
  and Administration, majoring in Accountancy.
  Richard and Deborah both travelled to the UK in 1988. They lived and worked in London until
  mid-1990 in between travelling through parts of Europe, Asia and Africa. Back in New Zealand
  Richard joined his present employer, Fixed Interest Securities (NZ) Ltd, in 1991 as a money
  market broker. Deborah worked for Deloitte Touche Tohmatsu as a tax consultant during 1991-95
  then continued part-time until 1997.
  Richard and Deborah lived at Hataitai for five years before moving to their present address in
  Karori in 1997.
